INSERT INTO `clanky` (`id`, `nazev`, `datum`, `viditelnost`, `nahled_foto`, `obsah`, `user_id`, `url`) VALUES
(796, 'Kolo pro život spustilo registraci na 26. sezónu! O tohle nechcete přijít!', '2025-03-12 19:40:00', 1, 'LW_240824_KPZ_CARDION_CHRUDIM_CZ_LQ_0089.jpg', '\r\n        \r\n        \r\n        Jubilejní čtvrtstoletí seriálu amatérských <b>cross-country maratonů </b>Kolo pro život jsme minulý rok <b>úspěšně oslavili</b>. Nyní, s prvními jarními dny, se otevírá <b>registrace na další ročník!</b><div><b><br></b></div><div><b><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered\" id=\"instagram-embed-0\" src=\"https://www.instagram.com/reel/DHBUSa1iVSk/embed/?cr=1&amp;v=14&amp;wp=675&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D796#%7B%22ci%22%3A0%2C%22os%22%3A629.7999999523163%2C%22ls%22%3A237.39999997615814%2C%22le%22%3A622.6000000238419%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"883\" data-instgrm-payload-id=\"instagram-media-payload-0\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></b><div><br></div><div>Kalendář je naprosto<b> totožný s minulým rokem</b>. Snad jen můžeme doufat, že na rozdíl od loňska se odehraje i <b>zastávka v Oderské Mlýnici</b>, jenž byla minulý rok zrušena v důsledku <b>povodní</b>. Stejně jako minulý rok pak závodníci mohou čekat <b>výborné zázemí a organizaci</b>, která přispívá jak ke spokojenosti samotných jezdců, tak i jejich rodin a doprovodů. Na všechny termíny se můžete podívat na&nbsp;<a href=\"https://www.kolopro.cz/\" target=\"_blank\"><b>oficiálních stránkách</b></a>.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered\" id=\"instagram-embed-1\" src=\"https://www.instagram.com/p/DBtZq33Ma1e/embed/?cr=1&amp;v=14&amp;wp=675&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D796#%7B%22ci%22%3A1%2C%22os%22%3A632.1000000238419%2C%22ls%22%3A237.39999997615814%2C%22le%22%3A622.6000000238419%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"748\" data-instgrm-payload-id=\"instagram-media-payload-1\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div>Novinkou je to, že <b>počet přihlášených závodníků je omezený</b>, a tak se může stát, že se na vás nedostane. Proto je dobré se<b> přihlásit co nejdřív</b>.</div><div><br></div><div>Rozdíl je rovněž i v cenách. Ty se proti minulému roku mírně <b>zvedly</b>. Zejména se to týká cen při <b>přihlášení na místě v den závodu</b>. Zdražení je v rozmezí asi zhruba<b> 50 - 200 Kč</b>. Na kompletní přehled se můžete mrknout&nbsp;<a href=\"https://www.kolopro.cz/serial/startovne-a-permice-2025\" target=\"_blank\"><b>tady</b></a></div><div><br></div><div><img src=\"data:image/png;base64,\" alt=\"\"></div><div><br></div><div>Stejně jako každý rok, chybět nebudou ani <b>permice</b>. Jejich odstupňování je ale rovněž trochu <b>pozměněné</b>. Základem je <b>KPŽ Silver</b>, jenž obsahuje startovné na <b>4 závody</b> a stojí <b>3 250 Kč</b>. Nad ní je verze <b>Silver VIP</b>, která jak již název napovídá, obsahuje VIP variantu startovného, díky kterému dostanete <b>nadstandardní péči</b>. Následuje <b>KPŽ Gold</b> na <b>8 závodů</b> s cenou <b>5 950 Kč </b>a vrcholem je<b> KPŽ Premium</b>, jenž má cenovku <b>11 950 Kč</b> a jedná se o startovné na<b> všechny závody s VIP variantou</b>. Na permanentky koukněte&nbsp;<a href=\"https://eshop.sportprozivot.cz/kategorie/kolo-pro-zivot/\" target=\"_blank\"><b>zde</b></a>.</div><div><br></div><div><b>Tak s kým se uvidíme na startu?</b></div>    </div>        ', 4, 'kolo-pro-zivot-spustilo-registraci-na-26-sezonu-o-tohle-nechcete-prijit');
